import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    width: 30%;
`
const Body = styled.div`
    background-color:#fff6e5;
    height:100%;
    width:100%;
    border-radius:25px;
`
const App = () => {
    return(
        <Container>
            <Body>
                <p>Icon</p>
            </Body>
            
        </Container>
    );
}

export default App;
